import React from "react";
import "./style.css";

function Header() {
  return (
    <React.Fragment>
        <header className="header">
            <h1>Google</h1>
            <h2>Search for your next book and save it</h2>
        </header>
    </React.Fragment>
  )
}

export default Header;
